import React from 'react';
import {BrowserRoute,}from 'react-router-dom';
import Home from './Home';
import SingleMovie from './SingleMovie';
function App() {
  return (
   <BrowserRoute>
   <Routes>
    <Route path="/" element={<Home/>}/>
    <Route path="movi/:id" element={<SingleMovie/>}/>
   </Routes>
   </BrowserRoute>
  )
}

export default App;
